import React, { Component } from 'react';

function recordView (id) {
    console.log(id)
}

class BottomNav extends Component {

    render() { 

        return (
        <div className="container">
            <ul>
                <li><a href="#calculator" id="calculator" onClick={this.recordView(this.id)}>Calculator</a></li>
                <li><a href="#data" id="data" onClick={this.recordView(this.id)}>Data</a></li>
            </ul> 
        </div>
            );
    }
}
 
export default BottomNav;
